//import Component1 from './Components/Component1';
import LargeComponent from "./Components/LargeComponent";
function App() {
  const items = [
    {date : new Date (2022,2,26) ,
      title : 'Oven' ,
      price : 150 },

    {date : new Date (2022,4,15) ,
      title : 'Hand Blender' ,
      price : 45},

    {date : new Date (2022,6,8) ,
      title : 'Fridge' ,
      price : 500 },

    {date : new Date (2022,11,14) ,
      title : 'Fan' ,
      price : 70},

    {date : new Date (2022,9,7) ,
      title : 'Microwave' ,
      price : 200}
  ];

  return (
    <div>
      <h2> Hello Shamousa Let's Goo </h2>
      <LargeComponent
        date = {items.date}
        title = {items.title}
        price = {items.price}
      ></LargeComponent>
    </div>
  );
}

export default App;
